import React, { useState, useEffect } from "react";
import './SignUp.css';
import logo from '../images/logo.png';
import container666 from '../images/hello.png';
import { Button } from '../components/Button.js';


const SignUp = (props) => {
  const [country, setCountry] = useState([]);
  const [countryid, setCountryid]=useState('');
    const [st, setSt]= useState([]);
    const [stateid, setStateid]= useState('');
    const [city, setCity]= useState([]);


  useEffect(() => {
    const getcountry = async () => {
      const rescountry = await fetch("http://localhost/devopsdeveloper/state/getstate/${countryid}");
      const rescon = await rescountry.json();
      setCountry(await rescon);
    }
    getcountry();
  }, []);

  const handlecountry=(event)=>{
    const getcountryid= event.target.value;
    setCountryid(getcountryid);
}

useEffect( ()=>{
const getstate= async()=>{
    const resstate= await fetch(`http://localhost/devopsdeveloper/state/getstate/${countryid}`);
    const resst= await resstate.json();
    setSt(await resst);
}
getstate();
},[countryid])

const handlestate=(event)=>{
   const getstateid= event.target.value;
   setStateid(getstateid);
}

useEffect( ()=>{
const getcity= async()=>{   
   const rescity= await fetch(`http://localhost/devopsdeveloper/city/getcity/${stateid}`);
   const rcity= await rescity.json();
   setCity(await rcity);
}
getcity();
},[stateid]);

  return (
    <form>
      <div className="sign-up-container">
        <div className="sign-up-sign-up">
          <div className="sign-up-frame416">
            <img
              src={logo}
              alt="logo"
              className="sign-up-logo"
            />
            <div className="sign-up-logo1"></div>
            <span className="sign-up-text">
              <span>TravelCompanion</span>
            </span>
          </div>
          <div className="sign-up-frame451">
            <span className="sign-up-text02 h4">
              <h1>Sign Up</h1>
            </span>
            <div className='signupbutton'>
              <Button className='subtn' buttonStyle='btn--outline' buttonSize='btn--large'>
                Submit
              </Button>
            </div>
            <div className="sign-up-frame453">
              <div className="sign-up-frame452">
                <span className="sign-up-text06 body1Bold">
                  <span className="sign-up-text07">First Name *</span>
                  <label htmlFor='username'></label>
                  <input type='text' className='box' placeholder='Enter first name' />
                </span>
                { }
              </div>
              <div className="sign-up-frame456">
                <span className="sign-up-text10 body1Bold">
                  <span className="sign-up-text11">Last Name *</span>
                  <label htmlFor='username'></label>
                  <input type='text' className='box' placeholder='Enter last name' />
                </span>
                { }
                { }
              </div>
              <div className="sign-up-frame4531">
                <span className="sign-up-text14 body1Bold">
                  <span className="sign-up-text15">D.O.B. *</span>
                  <label htmlFor='username'></label>
                  <input type='date' className='box' placeholder='Enter date of birth' />
                </span>
                { }
              </div>
              <div className="sign-up-frame4511">
                <span className="sign-up-text18 body1Bold">
                  <span className="sign-up-text19">Contact No. *</span>
                  <label htmlFor='username'></label>
                  <input type='tel' className='box' placeholder=' +91-9136229854' pattern="+[0-9]{2-5}-[0-9]{10-12}" required />
                </span>
                { }
              </div>
              <div className="sign-up-frame454">
                <span className="sign-up-text22 body1Bold">
                  <span className="sign-up-text23">Email *</span>
                  <label htmlFor='username'></label>
                  <input type='email' className='box' placeholder='Enter email' />
                </span>
                { }
              </div>
              <div className="sign-up-frame455">
                <span className="sign-up-text26 body1Bold">
                  <span className="sign-up-text27">Country *</span>
                  <label htmlFor='username'></label>
                  {/* <input type='text' className='box' placeholder='Enter country of residence'></input> */}
                  <select name="country" className="box"  onChange={(e)=>handlecountry(e)} >
                  <option value="">--Select Country--</option>
                  {
                 country.map( (getcon, index)=>(
